	if args != nil {
		// Select followed by () - add Args field
		argRecord := Record(args.([]Keyed[Node]))
		return Select{
			Receiver: left.(Node),
			Field:    name.(string),
			Args:     &argRecord,
			Loc: &SourceLocation{
				Line:   c.pos.line,
				Column: c.pos.col,
				Length: len(string(c.text)),
			},
		}, nil
	} else {
		// Just a Select
		return Select{
			Receiver: left.(Node),
			Field:    name.(string),
			Args:     nil,
			AutoCall: true,
			Loc: &SourceLocation{
				Line:   c.pos.line,
				Column: c.pos.col,
				Length: len(string(c.text)),
			},
		}, nil
	}
